ControlPropertyState.AutoRuleBindingString:
Switch(
    ThisItem.id,
    0,
    Navigate(
        scrHome,
        Fade
    ),
    1,
    Launch(theAppMakerURL &  "environments/" & vSelectedApp.'App Environment ID' & "/apps/" & vSelectedApp.App & "/details"),
    2,
    UpdateContext({showPopUp: true, showRepublish: true}),
    3,
    Launch(theAppPlayerURL & "play/" & vSelectedApp.App & "?tenatID=" & EnvVarTenantID),
    4,
    UpdateContext(
        {
            showPopUp: true,
            emailUsers: true
        }
    ),
    5,
    UpdateContext(
        {
            showPopUp: true,
            confirmDeletion: true
        }
    )
    ,
    6,
    UpdateContext(
        {
            showPopUp: true,
            showNewOwner: true,
            NewOwner: "",
            NewOwnerError: false
        }
    );
    Reset(txtInput_3)
)
